Boa tarde Priscila, 

tem disponível?

08 pilhas AA;
08 pilhas AAA;
02 baterias 3V-CR2032.

Att.Wânia

Laboratório 14
1- Sem CPU;
2- Não liga;
3- Fica em uma tela com textos e não liga;
4- Não liga e o teclado não funciona.

Peço por gentileza que alguém venha verificar por gentileza.

Bom dia, 

conforme conversado anteriormente, solicito a criação de um plano sintético com as tarefas e aquisições necessárias para construir cabeamento estruturado nas salas 39 e 40 da Unidade 1.

Requisitos: 
- Rede gigabit (cat 5e ou cat 6);
- 1 Switch integrando pelo menos ambas as salas;
- Uso de tubos em detrimento de canaletas (mesmo modelo presente nos equipamentos de identificação facil da prefeitura);
-  Pontos fêmeas na parede;
- Rack com patch panel (aproveitar algum já existente na instituição,como por exemplo, sala 5);
-  Identificar melhorias necessárias nos computadores (ex: placa de rede gigabit);

Boa tarde!

A impressora que é compartilhada com outras duas máquinas não esta imprimindo. Aparece uma mensagem de erro dizendo que não é possível fazer conexão, pois a impressora não foi encontrada no servidor;

Tentamos reiniciar, mas permaneceu o erro;

Se for possível, também, precisamos reabastecer o nível de tinta dessa mesma impressora.

Boa tarde Elaine, tudo bem?

Conforme deliberado hoje em reunião, estou encaminhando a demanda referente a instalação das divisórias na sala 28 conforme imagens em anexo.

O desenho não está na escala, as duas vigas na sala servem de referência;

Instalar tranca eletrônica em 2 portas de divisória que adentram para a sala de manutenção e na sala de servidores / racks;

Ver com a equipe técnica se o ar condicionado vai atender a toda a sala nesse novo formato;

Metade vidro;

Podemos conversar e ir ajustando qualquer necessidade à medida que avançar.

Boa tarde,
A impressora aqui da sala as vezes não imprime com o papel na bandeja principal;
As vezes fica dizendo que está sem papel;
Quando é dado o comando do computador para impressão a mesma demora para imprimir, apresentando lentidão.
As vezes está embernando (como se estivesse desligada) porém não está.
